"original": |2-
     This attribute indicates the number of Documents in the Job, i.e.,
     the number of Send-Document, Send-URI, Print-Job, or Print-URI
     operations that the Printer has accepted for this Job, regardless of
     whether the Document data has reached the Printer.
"fixed": |-
  This attribute indicates the number of Documents in the Job, i.e., the number of Send-Document, Send-URI, Print-Job, or Print-URI operations that the Printer has accepted for this Job, regardless of whether the Document data has reached the Printer.
"ko": |-
  이 속성은 작업의 문서 수, 즉 문서 데이터 도달 여부에 관계없이 프린터가 이 작업에 대해 수락한 문서 보내기, URI 보내기, 인쇄 작업 또는 인쇄 URI 작업 수를 나타냅니다. 프린터.
